lines = []

keys = {"1": "swadian", "5": "rhodok", "4": "nord", "2": "vaegir", "3": "khergit"}
def getKeyForLordKing(id):
    return keys[id[id.index("_")+1:id.rindex("_")]]
def getKeyForTroop(id):
    return id[0:id.index("_")]
def getKeyForLadies(id):
    return "ladies"
def printTroops(list,type,getkeyFun = getKeyForLordKing):
    troopMap = {}
    for troop in list:
        id = troop[0]
        troop_name = troop[1]
        flag = troop[3]
        items = troop[7]
        attr = troop[8]
        wp = troop[9]
        skill=troop[10]
        face1=troop[11]
        face2=troop[12] if(12 < len(troop)) else ""
        key = getkeyFun(id)
        if not troopMap.has_key(key):
            troopMap[key]=[]
        troopMap[key].append({
            "id":id,
            "troop_name":troop_name,
            "flag":flag,
            "items":items,
            "attr":attr,
            "wp":wp,
            "skill":skill,
            "face1":face1,
            "face2":face2
        })
    for key in troopMap.keys():
        lines.append(key+"_"+type+" = [\n")
        for troop in troopMap[key]:
            lines.append( "\t{\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t\t\"%s\":\"%s\",\n\t},\n"%(
                "id",troop["id"],"troop_name",troop["troop_name"],"flag",troop["flag"],"items",
                toString(troop["items"]) ,"attr",troop["attr"],"wp",troop["wp"],"skill",troop["skill"],
                "face1",troop["face1"],"face2",troop["face2"]))
        lines.append("]\n")
def toString(list):
    result = "["
    for item in list:
        result += item + ","
    result += "]"
    return result
