printTroops(lords,"lords")
printTroops(troops,"troops",getKeyForTroop)
printTroops(kings,"kings")
printTroops(pretenders,"pretender")
printTroops(wifes,"wifes",getKeyForLadies)
printTroops(daughters,"daughters",getKeyForLadies)

